class Store{subscribes={};static getItem(s){return JSON.parse(localStorage.getItem(s))}static setItem(s,t){localStorage.setItem(s,JSON.stringify(t)),this.subscribes?.[s]&&this.subscribes?.[s]?.forEach(s=>s(t))}static removeItem(s){localStorage.removeItem(s)}static subscribe(s,t){this.subscribes[s]||(this.subscribes[s]=[]),this.subscribes[s].push(t)}static unsubscribe(s,t){this.subscribes[s]&&(this.subscribes[s]=this.subscribes[s].filter(s=>s!==t))}}